import React from 'react';
import MainPage from './mainPage';
import LikePage from './likePage';
import DisLikePage from './dislikePage';

export default class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            showhideLikePage: false,
            showhideDisLikePage: false,
            showhideMainPage: true
        }
    }

    

    render () {
        const {showhideLikePage, showhideDisLikePage, showhideMainPage} = this.state;
        return (
            <div>
                {showhideMainPage && <MainPage />}
                {showhideLikePage && <LikePage />}
                {showhideDisLikePage && <DisLikePage />}
            </div>
        )
    }
}
